// Components/Farmer/Farmer.js

import React from 'react';
import Navigation from '../Navigation/NavigationPage';
import Footer from '../Footer/FooterPage';
import './Farmer.css'; // Import the CSS file
import farmerImage from '../assets/farmer.png';
import customerImage from '../assets/customer.png';
import workerImage from '../assets/worker.png';


const Farmer = () => {
  return (
    <div>
      <Navigation />
      <div className="content">
        <h1>Farmer Page</h1>
        <div className="blocks">
          <div className="block">
            <img src={"path/to/crops-image.jpg"} alt="Products" />
            <h2>Products</h2>
            <p>Information about various crops and their benefits.</p>
          </div>
          <div className="block">
            <img src={customerImage} alt="Sales" />
            <h2>Customer & Sales</h2>
            <p>Details about farming equipment and machinery.</p>
          </div>
          <div className="block">
            <img src="path/to/techniques-image.jpg" alt="Produces" />
            <h2>Produces & Problems</h2>
            <p>Best practices and techniques for efficient farming.</p>
          </div>
          <div className="block">
            <img src={workerImage} alt="Workers" />
            <h2>Works & Workers</h2>
            <p>Access to resources and support for farmers.</p>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Farmer;
